// import card4 from '../Images/card5.png'
export default function CardBottom(props) {
    // const {data} = props

        

  return (
    <div className='cardMain'>
        <img src={card1} alt='ss' className='cardImf'/>
        <div className='subCard'>
                <h1>dd</h1>
        </div>
    </div>
  )
}
